package com.jyp.greenhouse.core.util;

import sun.misc.BASE64Decoder;

import java.io.*;

import static java.util.Base64.getEncoder;

/**
 * Author   : jyp
 * Date     : 2017-04-25 13:31
 * Describe : Base64工具类
 */
public class Base64Util {
    public static String imageToBase64(String path) {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
        byte[] data = null;
        // 读取图片字节数组
        try {
            InputStream in = new FileInputStream(path);
            data = new byte[in.available()];
            in.read(data);
            in.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
        // 对字节数组Base64编码

        final String encoded =
                getEncoder()
                        .encodeToString(data);

        return encoded;
    }

    public static boolean base64ToImage(String base64, String path) {// 对字节数组字符串进行Base64解码并生成图片
        if (base64 == null) { // 图像数据为空
            return false;
        }
        try {
            BASE64Decoder decoder = new BASE64Decoder();
            byte[] bytes = decoder.decodeBuffer(base64);
//            byte[] bytes = new String(
//                    Base64.getDecoder().decode(base64),
//                    StandardCharsets.UTF_8).getBytes();
            for (int i = 0; i < bytes.length; ++i) {
                if (bytes[i] < 0) {// 调整异常数据
                    bytes[i] += 256;
                }
            }
            // 生成图片
            OutputStream out = new FileOutputStream(new File(path));
            out.write(bytes);
            out.flush();
            out.close();

            return true;
        } catch (Exception e) {
            e.printStackTrace();
            return false;
        }
    }


    public static void main(String[] args){
        Base64Util.base64ToImage("","D:\\360Downloads\\123.png");
    }
}
